if (!Array.isArray(headers)) {
    // If this fails, the path to headers is wrong.
    throw new Error('FATAL: Could not find headers array. Path or previous node output is incorrect.');
}
if (!Array.isArray(dataRows)) {
    // If this fails, the path to dataRows is wrong.
    throw new Error('FATAL: Could not find dataRows array. Path or previous node output is incorrect.');
}

// --- Data Transformation ---
const processedItems = dataRows.map(row => {
    const item = {};

    headers.forEach((header, index) => {
        item[header] = row[index];
    });

    // Output the transformed item in the expected n8n format
    return { json: item };
});

return processedItems;

const fullText = $input.first().json.text;

// Regex to match greeting separators (with or without *, & or "dan")
const separatorRegex = /\*?\s*Assal+amualaikum.*?Salam\s+Sejahtera\s*\*?/gi;

// Split the document
const reports = fullText
  .split(separatorRegex)
  .map(r => r.trim())
  .filter(r => r.length > 0);

// Return each report as its own item
return reports.map((report, index) => ({
  json: {
    reportNumber: index + 1,
    reportText: report
  }
}));

